import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/navegacion/Navbar';
import Inicio from './components/paginas/Inicio';
import Invernadero1 from './components/paginas/Invernadero1';
import Invernadero2 from './components/paginas/Invernadero2';
import Invernadero3 from './components/paginas/Invernadero3';
import Consultas from './components/paginas/Consultas';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Switch>
          <Route exact path="/" component={Inicio} />
          <Route path="/Invernadero1" component={Invernadero1} />
          <Route path="/Invernadero2" component={Invernadero2} />
          <Route path="/Invernadero3" component={Invernadero3} />
          <Route path="/Consultas" component={Consultas} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
